function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Home />
      <Sidebar />
      <Switch>

      <Route exact path="/" element= {<Home/>} />
      <Route path="/dog/:id" element={About} />
      <Route path="/favorites" element={Contact} />

      </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
